// Imports
import React from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import { URL } from '../helper';

import Button from '@mui/material/Button';

// Logouut button function
function Logout ({ token, setTokenFunction }) {
  const navigate = useNavigate();

  const logout = async () => {
    try {
      await axios.post(`${URL}/admin/auth/logout`, {}, {
        headers: {
          Authorization: token,
        }
      });
      // Logout successful
      // Clear token and go to login page
      setTokenFunction('');
      localStorage.clear();
      console.log('User token: ', token);
      navigate('/');
    } catch (err) {
      console.log(err);
      alert(err.response.data.error);
    }
  };

  return (
    <Button onClick={logout} type="submit" variant="outlined" color="inherit">Logout</Button>
  );
}

export default Logout;
